import React from 'react'
import { useLocation } from 'wouter'

const url404 = "https://cdn.dribbble.com/users/547471/screenshots/3063720/not_found.gif"

export default function Error404() {
    const [, pathLocation] = useLocation()

    const handleClick = () => {
        pathLocation('/')
    }

    return  <div id='container' className='bg-[#1b1b1b] h-screen relative flex justify-center items-center'>
                <div>
                    <div className='bg-red-500 bg-opacity-50 h-4 w-14 absolute top-6 left-80' onClick={handleClick}></div>
                <img src={url404} alt="error 404" className='object-fit  w-full h-full' />
                </div>  
            </div>
}
